import React,{useState, useEffect} from 'react'
import { DeleteOutline,Edit } from '@material-ui/icons';
import { Link} from 'react-router-dom'
import './dificultList.css'
import axios from "axios";

export default function DificultList() {

    const [dificults, setDificults] = useState([])

    useEffect(async () =>{
            const result = await axios('http://localhost:4500/api/dificultad')
            setDificults(result.dificults)

    })



      //<Edit className='dificultListEdit' />
      //<DeleteOutline className='dificultListDelete'/>

    return (
        <div className='dificultList'>
             <div>
                {dificults.map((item) => (
                <h3>{item.nombre}</h3>
        ))}
      </div>
        </div>
    )
}
